// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./interfaces/IGolToken.sol";
import "./interfaces/INonFungiblePlayer.sol";

contract Training is Ownable {
    using Counters for Counters.Counter;

    uint256 public maxStakedBlock;
    uint256 public updateTrainingLevelFee;
    uint256 public updateLevelFee;

    address private ownerAddr;

    struct StakeNFP {
        uint256 itemId;
        uint256 tokenId;
        uint256 startBlock;
        address owner;
        bool isEnded;
    }

    mapping(uint256 => StakeNFP) public stakedNfps;

    mapping(address => uint256) public trainingLevel;
    mapping(address => uint256) public countStakedNfps;

    INonFungiblePlayer private nonFungiblePlayer;
    IGolToken private golToken;

    Counters.Counter public stakingNfpCount;

    constructor(
        IGolToken _golToken,
        INonFungiblePlayer _nonFungiblePlayer,
        address _ownerAddr
    ) {
        golToken = _golToken;
        nonFungiblePlayer = _nonFungiblePlayer;
        maxStakedBlock = 5760000;
        updateTrainingLevelFee = 100;
        ownerAddr = _ownerAddr;
    }

    function setOwnerAddr(address _ownerAddr) public onlyOwner {
        ownerAddr = _ownerAddr;
    }

    function setUpdateTrainingLevelFee(uint256 _updateTrainingLevelFee)
        public
        onlyOwner
    {
        updateTrainingLevelFee = _updateTrainingLevelFee;
    }

    function setUpdateLevelFee(uint256 _updateLevelFee) public onlyOwner {
        updateLevelFee = _updateLevelFee;
    }

    function stakeNfpToTrain(uint256 _tokenId) public {
        require(
            msg.sender == nonFungiblePlayer.ownerOf(_tokenId),
            "You are not owner of NFP"
        );
        require(
            countStakedNfps[msg.sender] <= trainingLevel[msg.sender],
            "Staked Amount is limited for this training Level!"
        );

        nonFungiblePlayer.transferFrom(msg.sender, address(this), _tokenId);
        stakingNfpCount.increment();
        uint256 itemId = stakingNfpCount.current();

        stakedNfps[itemId] = StakeNFP(
            itemId,
            _tokenId,
            block.number,
            msg.sender,
            false
        );
        countStakedNfps[msg.sender]++;
    }

    function unStakeNfpFromTrain(uint256 _itemId) public {
        require(
            msg.sender == stakedNfps[_itemId].owner,
            "You are not owner of this NFP!"
        );
        require(
            stakedNfps[_itemId].isEnded == false,
            "This NFP is unstaked already!"
        );

        uint256 upgradableSP = (99900000 *
            (block.number - stakedNfps[_itemId].startBlock)) / maxStakedBlock;
        uint256 currentSP = nonFungiblePlayer.getSkillPoint(
            stakedNfps[_itemId].tokenId
        );

        // uint256 level = nonFungiblePlayer.getLevel(stakedNfps[_itemId].tokenId);
        if ((currentSP + upgradableSP) > 99900000) {
            currentSP = 99900000;
        } else currentSP += upgradableSP;

        currentSP = currentSP / 100000;
        nonFungiblePlayer.setSkillPoint(stakedNfps[_itemId].tokenId, currentSP);

        uint256 updateLvl = currentSP / 10;
        uint256 currentGEN = nonFungiblePlayer.getGeneration(
            stakedNfps[_itemId].tokenId
        );
        if (updateLvl > (currentGEN + 1) * 10 - 1)
            updateLvl = (currentGEN + 1) * 10 - 1;

        nonFungiblePlayer.setLevel(stakedNfps[_itemId].tokenId, updateLvl);

        if (updateLvl < 25)
            nonFungiblePlayer.setClass(stakedNfps[_itemId].tokenId, "Rookie");
        else if (updateLvl < 50)
            nonFungiblePlayer.setClass(stakedNfps[_itemId].tokenId, "Amateur");
        else if (updateLvl < 75)
            nonFungiblePlayer.setClass(stakedNfps[_itemId].tokenId, "Pro");
        else nonFungiblePlayer.setClass(stakedNfps[_itemId].tokenId, "Pro");

        nonFungiblePlayer.transferFrom(
            address(this),
            stakedNfps[_itemId].owner,
            stakedNfps[_itemId].tokenId
        );

        stakedNfps[_itemId].isEnded = true;
        countStakedNfps[msg.sender]--;
    }

    function getUpgradableSP(uint256 _itemId) public view returns (uint256) {
        uint256 upgradableSP = (99900000 *
            (block.number - stakedNfps[_itemId].startBlock)) / maxStakedBlock;
        uint256 currentSP = nonFungiblePlayer.getSkillPoint(
            stakedNfps[_itemId].tokenId
        );

        // uint256 level = nonFungiblePlayer.getLevel(stakedNfps[_itemId].tokenId);
        if ((currentSP + upgradableSP) > 99900000) {
            currentSP = 99900000;
        } else currentSP += upgradableSP;

        currentSP = currentSP / 100000;

        return currentSP;
    }

    function getStakedItems(address _owner)
        public
        view
        returns (StakeNFP[] memory)
    {
        uint256 totalItemCount = stakingNfpCount.current();
        uint256 itemCount = 0;
        uint256 currentIndex = 0;

        for (uint256 i = 1; i <= totalItemCount; i++) {
            if (
                _owner == stakedNfps[i].owner && stakedNfps[i].isEnded == false
            ) {
                itemCount += 1;
            }
        }

        StakeNFP[] memory stakedItems = new StakeNFP[](itemCount);

        for (uint256 i = 1; i <= totalItemCount; i++) {
            if (
                _owner == stakedNfps[i].owner && stakedNfps[i].isEnded == false
            ) {
                StakeNFP storage currentItem = stakedNfps[i];
                stakedItems[currentIndex] = currentItem;
                currentIndex += 1;
            }
        }

        return stakedItems;
    }

    function getStakedCount(address _owner) public view returns (uint256) {
        uint256 totalItemCount = stakingNfpCount.current();
        uint256 itemCount = 0;

        for (uint256 i = 1; i <= totalItemCount; i++) {
            if (
                _owner == stakedNfps[i].owner && stakedNfps[i].isEnded == false
            ) {
                itemCount += 1;
            }
        }

        return itemCount;
    }

    function updateTrainingLevel() public {
        require(
            trainingLevel[msg.sender] <= 999,
            "You are max level of training Camp"
        );

        require(
            golToken.balanceOf(msg.sender) >= updateTrainingLevelFee * 10**18,
            "Insuficient Balance of Gol Token"
        );

        golToken.transferFrom(
            msg.sender,
            ownerAddr,
            updateTrainingLevelFee * 10**18
        );

        trainingLevel[msg.sender]++;
    }

    // function updateLevel(uint256 _tokenId) public {
    //     require(
    //         golToken.balanceOf(msg.sender) >= updateLevelFee * 10**18,
    //         "Insuficient Balance of Gol Token"
    //     );

    //     uint256 currentSP = nonFungiblePlayer.getSkillPoint(_tokenId);
    //     uint256 currentLevel = nonFungiblePlayer.getLevel(_tokenId);
    //     uint256 currentGEN = nonFungiblePlayer.getGeneration(_tokenId);

    //     require(
    //         currentSP == (currentLevel + 1) * 10 - 1,
    //         "Not max Skill Point"
    //     );

    //     require(
    //         currentLevel < (currentGEN + 1) * 10 - 1,
    //         "Generation Limit executed!"
    //     );

    //     require(currentLevel < 100, "Max Level");

    //     currentLevel++;

    //     golToken.transferFrom(msg.sender, ownerAddr, updateLevelFee * 10**18);
    //     nonFungiblePlayer.setLevel(_tokenId, currentLevel);

    //     if (currentLevel < 25) nonFungiblePlayer.setClass(_tokenId, "Rookie");
    //     else if (currentLevel < 50)
    //         nonFungiblePlayer.setClass(_tokenId, "Amateur");
    //     else if (currentLevel < 75) nonFungiblePlayer.setClass(_tokenId, "Pro");
    //     else nonFungiblePlayer.setClass(_tokenId, "Pro");
    // }
}
